langManager:SetLangStr({
  ID = 901000010,
  TEXT = "Da Fam\195\173lia de Drag\195\181es ex\195\179ticos \195\169 bem parecido com um corvo, sabe usar algumas magias da Fam\195\173lia Drag\195\163o."
})
langManager:SetLangStr({
  ID = 901000020,
  TEXT = "O Porco rosa \195\169 t\195\163o bonitinho e faz muito sucesso com as meninas. Um grande companheiro em batalhas."
})
langManager:SetLangStr({
  ID = 901000030,
  TEXT = "Um elfinho que adora comer doce. Depois que se satisfaz tem desempenhos extraordin\195\161rios."
})
langManager:SetLangStr({
  ID = 901000040,
  TEXT = "Elfo local que no passado era especificamente respons\195\161vel pela gest\195\163o de Distritos na casa do Imperador Donghua. Sabe algumas magias."
})
langManager:SetLangStr({
  ID = 901000050,
  TEXT = "N\195\163o se sabe a origem deste Fantasma. Ele \195\169 travesso e muito divertido. Tome cuidado e n\195\163o se assuste com ele quando andar na rua anoite."
})
langManager:SetLangStr({
  ID = 901000060,
  TEXT = "O Esp\195\173rito Guerreiro usa uma foice e \195\169 muito leal ao dono. Muitas vez dar um golpe forte e mortal no iminigo em batalha."
})
langManager:SetLangStr({
  ID = 901000070,
  TEXT = "O Macaco de Fogo \195\169 muito temperamental, gosta de imitar o pr\195\179prio \195\173dolo - O Macaco Rei. Usa uma barra de ferro e bate forte nos inimigos."
})
langManager:SetLangStr({
  ID = 901000080,
  TEXT = "Uma fadinha companheira, se o dono fala bem dela, ela vai adicionar for\195\167a da \195\161gua no ataque do dono na batalha."
})
langManager:SetLangStr({
  ID = 901000090,
  TEXT = "Fadinha muito comum, parece n\195\163o ter muito poder, mas muitas pessoas gostam t\195\170-la por perto."
})
langManager:SetLangStr({
  ID = 901000100,
  TEXT = "\195\137 um monstro escuro e frio, bom em todos os tipos de ataques rel\195\162mpagos, gosta de atacar as pessoas que lhe irritam!"
})
langManager:SetLangStr({
  ID = 901000110,
  TEXT = "A Fada Flor t\195\170m um bom cora\195\167\195\163o, alegre e atenciosa. Sempre usa magia de recupera\195\167\195\163o no dono na batalha."
})
langManager:SetLangStr({
